import React, { useState } from 'react';
import './InsuranceForm.css';

const InsuranceForm = () => {
  const [gender, setGender] = useState('Male');
  const [name, setName] = useState('');
  const [dob, setDob] = useState('');
  const [mobile, setMobile] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`Name: ${name}, DOB: ${dob}, Gender: ${gender}, Mobile: ${mobile}`);
  };

  return (
    <div className="insurance-container">
      <h2>
        â‚¹<span className="blue">1 Crore</span> life cover starting from â‚¹485/month+
      </h2>

      <div className="badge-container">
        <div className="badge green">Get an Online Discount of 15%</div>
        <div className="badge gold">PB Promise Lowest Price Guarantee</div>
      </div>

      <div className="gender-toggle">
        <button
          className={gender === 'Male' ? 'active' : ''}
          onClick={() => setGender('Male')}
        >
          Male
        </button>
        <button
          className={gender === 'Female' ? 'active' : ''}
          onClick={() => setGender('Female')}
        >
          Female
        </button>
      </div>

      <form onSubmit={handleSubmit} className="form-box">
        <input
          type="text"
          placeholder="Enter Your Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
        <input
          type="text"
          placeholder="DD/MM/YYYY"
          value={dob}
          onChange={(e) => setDob(e.target.value)}
          required
        />
        <div className="mobile-input">
          <select>
            <option>India</option>
          </select>
          <span>+91</span>
          <input
            type="text"
            placeholder="Enter Mobile Number"
            value={mobile}
            onChange={(e) => setMobile(e.target.value)}
            required
          />
        </div>

        <button type="submit" className="view-btn">
          View Plans
        </button>

        <div className="whatsapp-info">
          ðŸ“© Only certified Policybazaar expert will assist you <br />
          <label>
            <input type="checkbox" defaultChecked /> Get updates on WhatsApp
          </label>
        </div>
      </form>

      <footer className="footer-info">
        <p>
          Policybazaar is one of <strong>India's leading digital</strong> insurance platforms
        </p>
        <div className="stats">
          <div><strong>9.7 Crore</strong><br />Registered Consumers</div>
          <div><strong>51</strong><br />Insurance Partners</div>
          <div><strong>4.9 Crore</strong><br />Policies Sold</div>
        </div>
      </footer>
    </div>
  );
};

export default InsuranceForm;
